Aj={title:"Easter Egg",loading:"Easter egg is trying its best to load...",error:"Failed to load despite best efforts, please retry"},Nj={title:"Update Plan",desc:"The following lists some future update plans. Everyone is welcome to contribute or help implement them. Currently, I am the only author, so the update speed may not be very fast. Thank you for your understanding!",link:"Repository URL: https://github.com/zaodonganqi/bettergi-script-web",author:"Author's Email: anqi4051{'@'}gmail.com",planList:[{desc:"Theme Color Support",content:"More theme colors (very simple, hoping developers who are willing to help will create theme colors) and dedicated management popups, supporting translucent themes and custom themes (storing theme color configuration json through repository js form and obtaining, local cache storing current usage), supporting custom background images under translucent mode."},{desc:"Enhance One-Click Subscription",content:"Find scripts you have already subscribed to among the updated scripts to filter those that can be updated with one click. Of course, blindly updating all of them isn't very slow right now anyway."},{desc:"Add Internal Tutorial Documentation (Resolved, can be viewed in official documentation)",content:"Add repository usage tutorial on the toolbar for computer novices."},{desc:"Draggable Content Areas (Resolved, try dragging the sidebar)",content:"Modify views like lists to be resizable by dragging rather than fixed values, and save the data locally (consider adding a configuration file in the main body if caching is unreliable)."},{desc:"More Powerful Search",content:"Enhance the search function. The current search is only keyword detection; fuzzy matching needs to be considered (this item has low priority, as it's a lot of effort for little reward)."},{desc:"More Advanced Animations",content:"Provide more animation effects for UI interactions."},{desc:"Improve the Updated Scripts List",content:"Add a route-like mechanism (but not actual routing) to the page, allowing click-to-navigate within the update view."},{desc:"Author's Whisper",content:"I won't write the whisper in the title, ehe! Currently, the author is quite busy juggling personal projects, studies, and work. Please don't blame me for the slow updates, wuwuwu. The best way to urge me to update is to sponsor the author or give this humble author a star (if you don't know what a star is, just forget it)."}]},Dj={title:"FAQ Q&A",modalTitle:"Note: Any questions should be thought through or documented before asking",author:"Author email: anqi4051{'@'}gmail.com",qa:[{q:"Why does the repository keep failing to load?",a:"The repository uses GitHub addresses, and direct connections from China may be intermittent, which is normal. If it doesn't open, try a few more times or come back in a few minutes. You can also use BGI's local repository page. (If you're a wizard, you know what to do)"},{q:"Why is the comment function unavailable?",a:"Comments are not supported in local mode. Please visit the online repository and log in to your GitHub account to comment. How to use GitHub, please search for yourself."},{q:"Why is there no XX script?",a:`When searching, try to ensure keywords are accurate, such as "Sweet Flower". If you've searched everything and still can't find it, then no author has written it. You can try writing one yourself.`},{q:"How to use the subscribed function?",a:`"BetterGI  Settings  BetterGI Http Server Settings" (if you can't find this setting, please make sure BGI is updated to the latest version), ensure this item is enabled and the port number is set to 30648. After completion, please close this page and restart BGI to try again. If there are still issues, please contact the author for resolution.`},{q:"What is README, why did it fail to load? Why is it not displayed?",a:"Read the README yourself first, do you understand it? Loading failure is the same as the first question. It's not displayed because there's no README.md file in that directory."},{q:"Why can't some links be clicked? Why does it load for a long time without loading?",a:"Same as the first question."},{q:"Why is there no response after clicking subscribe?",a:"Please open BGI, an import window will pop up, select import. If you're using the online repository and the script you subscribed to doesn't appear after refreshing the BGI page, please update the local repository and try again. If there are still issues, please ask in the relevant group."},{q:"What should I do if this script doesn't work?",a:"Please ask in the relevant group, specific problems require specific analysis. When asking, make sure your screenshots and descriptions are sufficient."},{q:"Why are my previous comments gone?",a:"Comments are generally not deleted. If comments disappear, it's likely because the node path you commented on has changed. For example, if the Crystal Ore directory was renamed to Crystal Water Ore, you'll see a new comment section."},{q:"Why doesn't this script use Nahida?",a:"Authors need to consider whether everyone has her. If needed, try making one yourself."},{q:"What should I do if I want XX function?",a:"If no author has written it, write one yourself!"},{q:"Others",a:"For more questions, please contact me. If valuable, this page will be updated periodically."}]},$j={descTitle:"Description: ",noDesc:"No description",loadTimeout:"Load timeout",loadFailed:"Load failed",clickToViewFile:"Click to view file in GitHub repository",clickToViewDir:"Click to view directory in GitHub repository",invalidLinkHint:"(This author is stupid and wrote the link wrong, go remind them to fix it)",iframeNotice:"Due to security restrictions, this content cannot be displayed directly. Please use local repository to view"},Mj={help:"Help",jumpToGitHub:"GitHub",comment:"Comment",subscribe:"One-Click Update",update:"Check for Updates",plan:"Update Plan",recent:"Recent Updates",updateAll:"Update All Subscriptions?",clearDot:"Clear Red Dot",subscrib
